content:
@itsLuciKeller I just do it while cycling
Or whenever I want now I live alone

But the truth is there’s no good analog for it. I have no desire to buy a car at present, but I jump at the chance to rent one whenever I travel for the pure unbridled joy of being in a soundproof box with my tunes

Eye floaters is killing my joy of music. 
