Zoom call: what has brought you joy lately?

Me: Received a special Holiday card in the mail from Z’s family 😍
@jazzydavenport https://t.co/xosEmerTgZ

@ninaturner @CornelWest 
Even in the darkest of times, these two exceptional humans bring me joy, just by being themselves. 
#HelloSomebody https://t.co/Xi4qRxxUSz

@rob_willeford One the bright side, they die but once.  

You and you alone determine how long the pain and grief lasts.  

Much respect for your loss. And may your joy over loving them be greater and last longer than your pain over losing them.
